import './App.css';
import MainSection from './components/section1/mainSection';
import ClickSpark from './components/spark/spark';
import DotGrid from '../src/components/bganimated/backani';

function App() {
  return (
    <ClickSpark
      sparkColor='#fff'
      sparkSize={30}
      sparkRadius={60}
      sparkCount={5}
      duration={700}
    >
      <div className='w-full flex flex-col items-center gap-20 max-w-full overflow-hidden'>
        <div style={{ width: '100%', height: '600px', position: 'relative' }}>
          <MainSection />
          <DotGrid
            dotSize={2}
            gap={10}
            baseColor="#5227FF"
            activeColor="#5227FF"
            proximity={10.}
            shockRadius={1}
            shockStrength={5}
            resistance={750}
            returnDuration={1.5}
          />
        </div>
      </div>
    </ClickSpark>
  );
}
export default App;
